        [
            tUser(parseInt("12306721")),
            '\u0414\u0430, \u043C\u043D\u0435 \u0435\u0433\u043E \u0443\u0436\u0435 \u043F\u0440\u0438\u0441\u043B\u0430\u043B\u0438. \u041C\u043E\u0436\u043D\u043E\u0437\u0430\u0434\u0430\u0442\u044C \u0432\u043E\u043F\u0440\u043E\u0441: \u0447\u0442\u043E \u043D\u0430\u0434\u043E \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0443 \u0434\u043B\u044F \u0441\u0447\u0430\u0441\u0442\u044C\u044F? \u041F\u043E\u0437\u0438\u0446\u0438\u044F: \u043D\u0435 \u0433\u043E\u0440\u0430 \u0434\u0435\u043D\u0435\u0433, \u0430 \u043B\u044E\u0431\u0438\u043C\u0430\u044F \u0440\u0430\u0431\u043E\u0442\u0430. \u0418\u043B\u0438: \u043A\u0430\u043A \u043D\u0443\u0436\u043D\u043E \u043E\u0442\u043D\u043E\u0441\u0438\u0442\u044C\u0441\u044F \u043A \u0441\u0432\u043E\u0435\u043C\u0443 \u0434\u0435\u043B\u0443?',

        [
            tUser(parseInt("47417400")),
            '\u0421\u0447\u0430\u0441\u0442\u044C\u0435 - \u044D\u0442\u043E \u043D\u0435 \u0433\u043E\u0440\u0430 \u0434\u0435\u043D\u0435\u0433, \u0441\u0447\u0430\u0441\u0442\u044C\u0435 - \u044D\u0442\u043E \u0434\u043E\u0431\u044B\u0432\u0430\u0442\u044C \u0441\u0432\u043E\u0439 \u0445\u043B\u0435\u0431 \u043B\u044E\u0431\u0438\u043C\u043E\u0439 \u0440\u0430\u0431\u043E\u0442\u043E\u0439\u00BB, - \u0433\u043E\u0432\u043E\u0440\u0438\u043B \u0434\u0435\u0434 \u0410\u043D\u0438\u0441\u0438\u043C.\n\u0421\u0430\u043C \u043E\u043D \u0432\u0441\u044E \u0436\u0438\u0437\u043D\u044C \u043A\u043B\u0430\u043B \u043F\u0435\u0447\u0438. \u041F\u043E\u0441\u0442\u0440\u043E\u0438\u043B\u0438 \u0434\u043E\u043C - \u0448\u043B\u0438 \u0432 \u0441\u0435\u043B\u043E \u0413\u043E\u0440\u043A\u0438 \u0437\u0430 \u0434\u0435\u0434\u043E\u043C - \u00AB\u0435\u0433\u043E \u043F\u0435\u0447\u0438 \u043D\u0438\u043A\u043E\u0433\u0434\u0430 \u043D\u0435 \u0434\u044B\u043C\u044F\u0442\u00BB.\n\n\u042F \u0443\u0432\u0438\u0434\u0435\u043B \u0434\u0435\u0434\u0430 \u0410\u043D\u0438\u0441\u0438\u043C\u0430 \u0441\u0435\u043C\u0438 \u043B\u0435\u0442, \u043A\u043E\u0433\u0434\u0430 \u043E\u0442\u0435\u0446 \u043F\u043E\u0437\u0432\u0430\u043B \u0434\u0435\u0440\u0435\u0432\u0435\u043D\u0441\u043A\u043E\u0433\u043E \u043C\u0430\u0441\u0442\u0435\u0440\u0430 \u043F\u043E\u0447\u0438\u043D\u0438\u0442\u044C \u043F\u0435\u0447\u044C: \u00AB\u0414\u044B\u043C\u0438\u0442\u2026\u00BB \u0414\u0432\u0430 \u0434\u043D\u044F \u0434\u0435\u0434 \u043A\u043E\u0432\u044B\u0440\u044F\u043B\u0441\u044F \u0432 \u043D\u0430\u043F\u043E\u043B\u043E\u0432\u0438\u043D\u0443 \u0440\u0430\u0437\u043E\u0431\u0440\u0430\u043D\u043D\u043E\u0439 \u043F\u0435\u0447\u0438. \u041A\u043E\u0433\u0434\u0430 \u0440\u0430\u0431\u043E\u0442\u0430 \u0431\u044B\u043B\u0430 \u043E\u043A\u043E\u043D\u0447\u0435\u043D\u0430, \u043F\u043E\u0437\u0432\u0430\u043B \u043C\u0435\u043D\u044F \u043F\u043E\u043B\u0438\u0442\u044C \u0438\u0437 \u043A\u043E\u0432\u0448\u0438\u043A\u0430 \u0432\u043E\u0434\u044B \u0435\u043C\u0443 \u043D\u0430 \u0440\u0443\u043A\u0438. \u0410 \u043F\u043E\u0442\u043E\u043C, \u0441\u0438\u0434\u044F \u0437\u0430 \u043D\u0430\u043A\u0440\u044B\u0442\u044B\u043C \u0441\u0442\u043E\u043B\u043E\u043C, \u043E\u043F\u044F\u0442\u044C \u043F\u043E\u0437\u0432\u0430\u043B, \u0445\u0438\u0442\u0440\u043E \u0443\u043B\u044B\u0431\u0430\u044F\u0441\u044C: \u00AB\u041F\u043E\u0433\u043B\u044F\u0434\u0438, \u0412\u0430\u0441\u044F\u0442\u043A\u0430, \u0438\u0434\u0435\u0442 \u043B\u0438 \u0434\u044B\u043C \u0438\u0437 \u0442\u0440\u0443\u0431\u044B?\u00BB \u00AB\u0418\u0434\u0435\u0442!\u00BB - \u043A\u0440\u0438\u043A\u043D\u0443\u043B \u044F \u0432 \u043E\u0442\u043A\u0440\u044B\u0442\u043E\u0435 \u043E\u043A\u043D\u043E. \u00AB\u0425\u043E\u0440\u043E\u0448\u043E! \u042D\u0442\u043E \u0440\u0430\u0434\u043E\u0441\u0442\u044C \u0434\u043B\u044F \u0432\u0441\u0435\u0445 \u0438 \u0432 \u043F\u0435\u0440\u0432\u0443\u044E \u043E\u0447\u0435\u0440\u0435\u0434\u044C \u0434\u043B\u044F \u043C\u0435\u043D\u044F\u2026\u00BB\n\n\u0421 \u0442\u0435\u0445 \u043F\u043E\u0440, \u043A\u043E\u0433\u0434\u0430 \u044F \u0432\u0438\u0434\u0435\u043B \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430, \u043A\u043E\u0442\u043E\u0440\u043E\u043C\u0443 \u0435\u0433\u043E \u0440\u0430\u0431\u043E\u0442\u0430 \u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0431\u043E\u043B\u044C\u0448\u0443\u044E \u0440\u0430\u0434\u043E\u0441\u0442\u044C, \u0432\u0441\u043F\u043E\u043C\u0438\u043D\u0430\u043B \u0434\u0435\u0434\u0430 \u0410\u043D\u0438\u0441\u0438\u043C\u0430. \u0418 \u0432 \u044D\u0442\u043E\u0442 \u0440\u0430\u0437, \u0443\u0432\u0438\u0434\u0435\u0432 \u043E\u0440\u0435\u043D\u0431\u0443\u0440\u0433\u0441\u043A\u043E\u0433\u043E \u0444\u043E\u0442\u043E\u0433\u0440\u0430\u0444\u0430 \u0421\u0435\u0440\u0433\u0435\u044F \u0416\u0434\u0430\u043D\u043E\u0432\u0430 \u0437\u0430 \u0440\u0430\u0431\u043E\u0442\u043E\u0439, \u0443\u043B\u044B\u0431\u043D\u0443\u043B\u0441\u044F: \u00AB\u042D\u0442\u043E \u043A\u0430\u043A \u043C\u043E\u0439 \u0437\u0435\u043C\u043B\u044F\u043A-\u043F\u0435\u0447\u043D\u0438\u043A\u2026\u00BB\n\n\u0424\u043E\u0442\u043E\u0433\u0440\u0430\u0444 \u0421\u0435\u0440\u0433\u0435\u0439 \u0416\u0434\u0430\u043D\u043E\u0432 \u0438\u043C\u0435\u0435\u0442 \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u043E \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u0439: \u0440\u0430\u0431\u043E\u0442\u0430\u043B \u0438\u043D\u0436\u0435\u043D\u0435\u0440\u043E\u043C, \u0431\u044B\u043B \u043D\u0430 \u0432\u043E\u0435\u043D\u043D\u043E\u0439 \u0441\u043B\u0443\u0436\u0431\u0435, \u0440\u0443\u043A\u043E\u0432\u043E\u0434\u0438\u043B \u043E\u0431\u043B\u0430\u0441\u0442\u043D\u044B\u043C \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u043E\u043C \u043E\u0445\u043E\u0442\u043D\u0438\u043A\u043E\u0432, \u0441\u0430\u043C \u0431\u044B\u043B \u0445\u043E\u0440\u043E\u0448\u0438\u043C \u043E\u0445\u043E\u0442\u043D\u0438\u043A\u043E\u043C, \u0440\u0443\u0436\u044C\u0435 \u043F\u043E\u0432\u0435\u0441\u0438\u043B \u043D\u0430 \u0433\u0432\u043E\u0437\u0434\u044C \u043F\u043E\u0441\u043B\u0435 \u043E\u0434\u043D\u043E\u0433\u043E \u0441\u043B\u0443\u0447\u0430\u044F. \u00AB\u041F\u043E\u0434\u0441\u0442\u0440\u0435\u043B\u0438\u043B \u0437\u0430\u0439\u0446\u0430. \u041E\u043D \u043A\u0440\u0438\u0447\u0430\u043B, \u043A\u0430\u043A \u0440\u0435\u0431\u0435\u043D\u043E\u043A, \u0431\u0430\u0431\u044B \u0441 \u0434\u043E\u0440\u043E\u0433\u0438 \u043F\u0440\u0438\u0431\u0435\u0436\u0430\u043B\u0438, \u0434\u0443\u043C\u0430\u043B\u0438, \u0447\u0442\u043E \u0441\u043B\u0443\u0447\u0438\u043B\u043E\u0441\u044C \u043D\u0435\u0441\u0447\u0430\u0441\u0442\u044C\u0435. \u0410 \u0443 \u043C\u0435\u043D\u044F \u043A\u0430\u043A \u0440\u0430\u0437 \u0440\u043E\u0434\u0438\u043B\u0441\u044F \u0441\u044B\u043D - \u0432\u0441\u0451, \u0431\u0440\u043E\u0441\u0438\u043B \u043E\u0445\u043E\u0442\u0443. \u041D\u043E \u0441\u0442\u0440\u0430\u0441\u0442\u044C \u043E\u0445\u043E\u0442\u043D\u0438\u043A\u0430 \u043E\u0441\u0442\u0430\u043B\u0430\u0441\u044C. \u0412\u0441\u043F\u043E\u043C\u043D\u0438\u043B: \u0435\u0441\u0442\u044C \u0435\u0449\u0435 \u0444\u043E\u0442\u043E\u043A\u0430\u043C\u0435\u0440\u0430. \u041D\u0430\u0447\u0430\u043B \u0441\u043D\u0438\u043C\u0430\u0442\u044C \u0438 \u043F\u043E\u043D\u044F\u043B: \u0434\u043E \u044D\u0442\u043E\u0433\u043E \u0437\u043D\u0430\u043B \u043D\u0435 \u0441\u0432\u043E\u0438 \u0434\u0435\u043B\u0430. \u041C\u0438\u0440 \u043F\u0440\u0438\u0440\u043E\u0434\u044B \u0441\u0442\u0430\u043B \u0434\u043B\u044F \u043C\u0435\u043D\u044F \u0431\u0435\u0441\u043A\u043E\u043D\u0435\u0447\u043D\u043E \u0434\u043E\u0440\u043E\u0433\u0438\u043C. \u0421\u0435\u0439\u0447\u0430\u0441 \u0434\u0435\u043B\u0430\u044E \u0432\u0441\u0451 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0435, \u0447\u0442\u043E\u0431\u044B \u0441\u043A\u0430\u0437\u0430\u0442\u044C \u043E\u0431 \u044D\u0442\u043E\u043C \u0434\u0440\u0443\u0433\u0438\u043C \u043B\u044E\u0434\u044F\u043C.\n\n\u0412\u043F\u0435\u0440\u0432\u044B\u0435 \u044F \u0443\u0441\u043B\u044B\u0448\u0430\u043B \u043E\u0431 \u043E\u0440\u0435\u043D\u0431\u0443\u0440\u0433\u0441\u043A\u043E\u043C \u043E\u0445\u043E\u0442\u043D\u0438\u043A\u0435 \u0431\u0435\u0437 \u0440\u0443\u0436\u044C\u044F \u043D\u0430 \u0432\u044B\u0441\u0442\u0430\u0432\u043A\u0435 \u00AB\u0417\u043E\u043B\u043E\u0442\u0430\u044F \u0447\u0435\u0440\u0435\u043F\u0430\u0445\u0430\u00BB \u0432 \u041C\u043E\u0441\u043A\u0432\u0435. \u041E\u043D \u0437\u0430\u043D\u044F\u043B \u043F\u0440\u0438\u0437\u043E\u0432\u043E\u0435 \u043C\u0435\u0441\u0442\u043E \u0432 \u043F\u0435\u0440\u0432\u043E\u0439 \u0434\u0435\u0441\u044F\u0442\u043A\u0435. \u00AB\u0421\u043D\u0438\u043C\u0430\u0442\u044C \u0436\u0438\u0432\u043E\u0442\u043D\u044B\u0445 \u0438\u043D\u0442\u0435\u0440\u0435\u             '\u0421 \u0431\u0435\u0440\u0451\u0437 \u043D\u0435\u0441\u043B\u044B\u0448\u0435\u043D, \u043D\u0435\u0432\u0435\u0441\u043E\u043C\n\u0421\u043B\u0435\u0442\u0430\u0435\u0442 \u0436\u0451\u043B\u0442\u044B\u0439 \u043B\u0438\u0441\u0442,\n\u0421\u0442\u0430\u0440\u0438\u043D\u043D\u044B\u0439 \u0432\u0430\u043B\u044C\u0441 \"\u041E\u0441\u0435\u043D\u043D\u0438\u0439 \u0441\u043E\u043D\"\n\u0418\u0433\u0440\u0430\u0435\u0442 \u0433\u0430\u0440\u043C\u043E\u043D\u0438\u0441\u0442.\n\u0412\u0437\u0434\u044B\u0445\u0430\u044E\u0442, \u0436\u0430\u043B\u0443\u044F\u0441\u044C, \u0431\u0430\u0441\u044B,\n\u0418, \u0441\u043B\u043E\u0432\u043D\u043E \u0432 \u0437\u0430\u0431\u044B\u0442\u044C\u0438,\n\u0421\u0438\u0434\u044F\u0442 \u0438 \u0441\u043B\u0443\u0448\u0430\u044E\u0442 \u0431\u043E\u0439\u0446\u044B,\n\u0422\u043E\u0432\u0430\u0440\u0438\u0449\u0438 \u043C\u043E\u0438.\n\n\u041F\u043E\u0434 \u044D\u0442\u043E\u0442 \u0432\u0430\u043B\u044C\u0441 \u0432\u0435\u0441\u0435\u043D\u043D\u0438\u043C \u0434\u043D\u0451\u043C\n\u0425\u043E\u0434\u0438\u043B\u0438 \u043C\u044B \u043D\u0430 \u043A\u0440\u0443\u0433,\n\u041F\u043E\u0434 \u044D\u0442\u043E\u0442 \u0432\u0430\u043B\u044C\u0441 \u0432 \u043A\u0440\u0430\u044E \u0440\u043E\u0434\u043D\u043E\u043C\n\u041B\u044E\u0431\u0438\u043B\u0438 \u043C\u044B \u043F\u043E\u0434\u0440\u0443\u0433,\n\u041F\u043E\u0434 \u044D\u0442\u043E\u0442 \u0432\u0430\u043B\u044C\u0441 \u043B\u043E\u0432\u0438\u043B\u0438 \u043C\u044B\n\u041E\u0447\u0435\u0439 \u043B\u044E\u0431\u0438\u043C\u044B\u0445 \u0441\u0432\u0435\u0442,\n\u041F\u043E\u0434 \u044D\u0442\u043E\u0442 \u0432\u0430\u043B\u044C\u0441 \u0433\u0440\u0443\u0441\u0442\u0438\u043B\u0438 \u043C\u044B,\n\u041A\u043E\u0433\u0434\u0430 \u043F\u043E\u0434\u0440\u0443\u0433\u0438 \u043D\u0435\u0442.\n\n\u0418 \u0432\u043E\u0442 \u043E\u043D \u0441\u043D\u043E\u0432\u0430 \u043F\u0440\u043E\u0437\u0432\u0443\u0447\u0430\u043B\n\u0412 \u043B\u0435\u0441\u0443 \u043F\u0440\u0438\u0444\u0440\u043E\u043D\u0442\u043E\u0432\u043E\u043C,\n\u0418 \u043A\u0430\u0436\u0434\u044B\u0439 \u0441\u043B\u0443\u0448\u0430\u043B \u0438 \u043C\u043E\u043B\u0447\u0430\u043B\n\u041E \u0447\u0451\u043C-\u0442\u043E \u0434\u043E\u0440\u043E\u0433\u043E\u043C.\n\u0418 \u043A\u0430\u0436\u0434\u044B\u0439 \u0434\u0443\u043C\u0430\u043B \u043E \u0441\u0432\u043E\u0435\u0439,\n\u041F\u0440\u0438\u043F\u043E\u043C\u043D\u0438\u0432 \u0442\u0443 \u0432\u0435\u0441\u043D\u0443,\n\u0418 \u043A\u0430\u0436\u0434\u044B\u0439 \u0437\u043D\u0430\u043B - \u0434\u043E\u0440\u043E\u0433\u0430 \u043A \u043D\u0435\u0439\n\u0412\u0435\u0434\u0451\u0442 \u0447\u0435\u0440\u0435\u0437 \u0432\u043E\u0439\u043D\u0443.\n\n\u041F\u0443\u0441\u0442\u044C \u0441\u0432\u0435\u0442 \u0438 \u0440\u0430\u0434\u043E\u0441\u0442\u044C \u043F\u0440\u0435\u0436\u043D\u0438\u0445 \u0432\u0441\u0442\u0440\u0435\u0447\n\u041D\u0430\u043C \u0441\u0432\u0435\u0442\u044F\u0442 \u0432 \u0442\u0440\u0443\u0434\u043D\u044B\u0439 \u0447\u0430\u0441,\n\u0410 \u043A\u043E\u043B\u044C \u043F\u0440\u0438\u0434\u0451\u0442\u0441\u044F \u0432 \u0437\u0435\u043C\u043B\u044E \u043B\u0435\u0447\u044C,\n\u0422\u0430\u043A \u044D\u0442\u043E \u0436 \u0442\u043E\u043B\u044C\u043A\u043E \u0440\u0430\u0437.\n\u041D\u043E \u043F\u0443\u0441\u0442\u044C \u0438 \u0441\u043C\u0435\u0440\u0442\u044C \u0432 \u043E\u0433\u043D\u0435, \u0432 \u0434\u044B\u043C\u0443\n\u0411\u043E\u0439\u0446\u0430 \u043D\u0435 \u0443\u0441\u0442\u0440\u0430\u0448\u0438\u0442,\n\u0418 \u0447\u0442\u043E \u043F\u043E\u043B\u043E\u0436\u0435\u043D\u043E \u043A\u043E\u043C\u0443\n\u041F\u0443\u0441\u0442\u044C \u043A\u0430\u0436\u0434\u044B\u0439 \u0441\u043E\u0432\u0435\u0440\u0448\u0438\u0442.\n\n\u0422\u0430\u043A \u0447\u0442\u043E \u0436, \u0434\u0440\u0443\u0437\u044C\u044F, \u043A\u043E\u043B\u044C \u043D\u0430\u0448 \u0447\u0435\u0440\u0451\u0434,\n\u0414\u0430 \u0431\u0443\u0434\u0435\u0442 \u0441\u0442\u0430\u043B\u044C \u043     function tUser(fromId) {
        if (fromId < 2000000000 && users[fromId]) {
            var user = users[fromId];
            return '<img src="' + user.photo200Orig + '" width="32" height="32"><br>' + user.firstName + ' ' + user.lastName;
        } else
            return 'o_0';
    }

    function tAttachments(attachments) {
        if (attachments) {
            var resultHtml = '';
            attachments.forEach(function (attachment) {
                switch (attachment.type) {
                    case 'photo':
                        resultHtml += '<a href="' + attachment.photo.photo604 + '" target="_blank"><img src="' + attachment.photo.photo130 + '" width="64" height="64"></a>';
                        break;
                    case 'sticker':
                        resultHtml += '<img src="' + attachment.sticker.photo64 + '" width="64" height="64">';
                        break;
                    case 'gift':
                        resultHtml += '<img src="' + attachment.gift.thumb96 + '" width="64" height="64">';
                        break;
                    case 'audio':
                        resultHtml += '[audio: ' + attachment.audio.title + '], ';
                        break;
                    case 'doc':
                        switch (attachment.doc.type) {
                            case 5:
                                resultHtml += '<a href="' + attachment.doc.url + '" target="_blank">[voice]</a>';
                                break;
                            default:
                                resultHtml += '[doc: ' + attachment.doc.title + '], ';
                                break;
                        }
                        break;
                    default:
                        resultHtml += attachment.type + ', ';
                        break;
                }
            });
            return resultHtml;
        } else return '';
    }
